import React from 'react'

export default function List({ movies }) {
  return (
	<div className='List'>
    {movies.map((movie) => {
      return(
        <div className="div">
          <div className="name">
            <p>{movie.name}</p>
          </div>
          <div className="info">
            <p>{movie.rating}</p>
            <i class="fa-regular fa-eye"></i>
            <i class="fa-solid fa-trash"></i>
            <i class="fa-solid fa-star"></i>
          </div>
        </div>
        
      )
    })}
  </div>
  )
}
